// @namespace      http://userscripts.org
// @description    On HaloWars.com, stops the background from staying put, which makes scrolling slow in Firefox. Displays military rank information near the top a player's stats page. When searching for a user, automatically redirects you when only one result is returned.
// @include        http://www.halowars.com/*
