/* version 3/8/2010 */

function getScore(page)
{
	if(page == null)
	{
		return parseInt(document.getElementById("ctl00_bcr_lblTotalScore").innerHTML.replace(/,/g,""), 10);
	}
	else
	{
		var html = new XMLHttpRequest();
		html.open("GET", page, false);
		html.send(null);
		try
		{
			return  parseInt(/<span id=['"]ctl00_bcr_lblTotalScore['"]>([0-9,]*)<\/span>/.exec(html.responseText)[1].replace(/,/g,""), 10);
		}
		catch (ex)
		{	
			return 0;
		}
	}
}

function addCommas(nStr)
{
	//http://mredkj.com/javascript/numberFormat.html
	nStr += '';
	x = nStr.split('.');
	x1 = x[0];
	x2 = x.length > 1 ? '.' + x[1] : '';
	var rgx = /(\d+)(\d{3})/;
	while (rgx.test(x1)) {
		x1 = x1.replace(rgx, '$1' + ',' + '$2');
	}
	return x1 + x2;
}

